import React, { useState } from "react";
import {
  View,
  TextInput,
  StyleSheet,
  Text,
  TouchableOpacity as TO,
} from "react-native";

export default function SingUp() {
  const [textName, setName] = useState(" ");
  const [textData, setData] = useState(" ");
  const [textPhone, setPhone] = useState(" ");
  const [textCPF, setCPF] = useState(" ");
  const [textStd, setStd] = useState(" ");
  const [textCity, setCity] = useState(" ");
  const [textGenre, setGenre] = useState(" ");

  const next = "Próximo";

  return (
    <>
      <View style={styles.container}>
        <View style={styles.title}>
          <Text>Digite seus dados para se cadastrar</Text>
        </View>

        <Text>Nome Completo</Text>
        <TextInput
          style={styles.box}
          onChangeText={(e) => setName(e)}
          value={textName}
          placeholder="Digite seu nome"
        />

        <Text>Data de Nascimento</Text>
        <TextInput
          style={styles.box}
          onChangeText={(e) => setData(e)}
          value={textData}
          placeholder="Data Nascimento"
        />

        <Text>Telefone</Text>
        <TextInput
          style={styles.box}
          onChangeText={(e) => setPhone(e)}
          value={textPhone}
          placeholder="Telefone"
        />

        <Text>CPF</Text>
        <Textinput
          style={styles.box}
          onChangeText={(e) => setCPF(e)}
          value={textCPF}
          placeholder="CPF"
        />

        <View>
          <Text>Estado</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setStd(e)}
            value={textStd}
            placeholder="Estado"
          />

          <Text>Cidade</Text>
          <TextInput
            style={styles.box}
            onChangeText={(e) => setCity(e)}
            value={textCity}
            placeholder="Cidade"
          />
        </View>

        <Text>Gênero</Text>
        <TextInput
          style={styles.box}
          onChangeText={(e) => setGenre(e)}
          value={textGenre}
          placeholder="Gênero"
        />

        <View>
          <TO style={styles.to}>
            <Text>{next}</Text>
          </TO>
        </View>

        <View>
          <Text>Já se cadastrou? Entrar</Text>
        </View>
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#83A1EF",
    justifyContent: "center",
    alignItems: "center",
  },
  lugar: {},
  title: {},
  box: {
    paddingLeft: 5,
    marginBottom: 5,
    width: 250,
    height: 40,
    borderColor: "black",
    borderWidth: 1,
    borderRadius: 10,
  },
  to: {
    borderColor: "black",
    borderWidth: 1,
  },
});
